if (document.getElementById('products')) {
    document.getElementById('products').innerHTML =`${products.map((item,index)=>
        `<div class="col-md-6 col-lg-4">
    <div class="team-member">
<!-- Team Member 2 Img-->
        <div class="team-img">
            <img src="${item.image}" alt="team member2" title="${item.image}" class="img-responsive text-center media-object">
        </div>
<!-- Team Member 2 hover Details-->
        <div class="team-hover">
            <div class="desk">
                <h4>${item.Brand}</h4>
                <h6>${item.Color}</h6><br>
            </div>
<!-- Social Network-->
            <div class="social-link">
                <a href="detail.html" onclick="detail(${index})"><i class="fa fa-shopping-basket" id="item"></i></a>
                 </div>
        </div>
    </div>
<!-- Team Member 2 Details-->
    <div class="team-heading">
        <p>${item.Name}</p>
        <h3 style="color: black;">&dollar;${item.Price}</h3>
    </div>
</div> `
        ).join('')}`
}



function detail(item_Detail){
   localStorage.setItem('index',item_Detail)
}

    function loadDetail(){
    let itemDetail = Number(localStorage.getItem('index'))
      

    document.getElementById('item').innerHTML = `
    <!-- Portfolio Item Heading -->
    <h1 class="my-4"> ${products[itemDetail].Name}
      <small>&dollar;${products[itemDetail].Price}</small>
    </h1>
<!-- Portfolio Item Row -->
    <div class="row">

      <div class="col-md-8">
        <img class="img-fluid" src="${products[itemDetail].limage}" alt="">
      </div>

      <div class="col-md-4">
        <h3 class="my-3"> Description</h3>
        <p> ${products[itemDetail].Description}</p>
        <h3 class="my-3"> Details</h3>
        <ul>
          <li><p>color:  ${products[itemDetail].Color}</p></li>
          <li><p>size:  ${products[itemDetail].Size}</p></li>
          <li><p>pant size:  ${products[itemDetail].pantSize}</p></li>
          <li><p>shoe size:  ${products[itemDetail].shoeSize}</p></li>
        </ul>
      </div>

    </div>


` ;
related(5);
    }

